import React, { useState } from "react";
import {
  Button,
  Form,
  FormGroup,
  Label,
  Input,
  Alert,
  Col,
  Row,
  // Dropdown,
  // DropdownToggle,
  // DropdownMenu,
  // DropdownItem,
} from "reactstrap";

const FirstPage = ({ onNextStep }) => {
  const [values, setValues] = useState({
    photo: "",
    email: "",
    firstName: "",
    lastName: "",
    experience: "",
    password: "",
    company: "",
  });

  const handleChange = (e) => {
    setValues({ ...values, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log("Form values:", values);
    // Perform necessary actions like submitting the form data
    onNextStep();
    handleChange();
  };

  // const [dropdownOpen, setDropdownOpen] = useState(false);

  // const toggle = () => setDropdownOpen((prevState) => !prevState);

  return (
    <Form onSubmit={handleSubmit}>
      <Alert color="info">
        <strong>Lovely to see you!</strong>
        <br /> Filling out the form only takes a couple of minutes. We&apos;d
        love to learn more about your background and the ins-and-outs of why
        you&apos;d like to become a mentor. Keep things personal and talk
        directly to us and your mentees. We don&apos;t need jargon and polished
        cover letters here! <br />
        <br />
        You agree to our code of conduct and the mentor agreement by sending the
        form, so be sure to have a look at those.
      </Alert>

      <FormGroup>
        {/* <span>
                <img alt="Profile" src="/assets/img/profiles/l-1.jpg" />
              </span> */}
        <Label for="photo">Photo</Label>
        <Input type="file" name="photo" id="photo" required/>
      </FormGroup>

      <Row>
        <Col md={6}>
          <FormGroup>
            <Label for="firstName">First Name*</Label>
            <Input
              id="firstName"
              name="firstNAme"
              type="text"
              required
            />
          </FormGroup>
        </Col>
        <Col md={6}>
          <FormGroup>
            <Label for="lastName">Last Name*</Label>
            <Input
              id="lastName"
              name="lastName"
              type="text"
              required
            />
          </FormGroup>
        </Col>
      </Row>
      <Row>
        <Col md={6}>
          <FormGroup>
            <Label for="email">Email*</Label>
            <Input type="email" name="email" id="email" required />
          </FormGroup>
        </Col>
        <Col md={6}>
          <FormGroup>
            <Label for="password">Choose a Password*</Label>
            <Input type="password" name="password" id="password" required />
          </FormGroup>
        </Col>
      </Row>

      <Row>
        <Col md={6}>
          <FormGroup>
            <Label for="jobTitle">Job Title*</Label>
            <Input type="text" name="jobTitle" id="jobTitle" required />
          </FormGroup>
        </Col>
        <Col md={6}>
          <FormGroup>
            <Label for="company">Company</Label>
            <Input type="text" name="company" id="company"  />
          </FormGroup>
        </Col>
      </Row>
      <FormGroup>
        <Col md={8}>
          <Label for="Location">Location</Label>
          <Input type="select" name="category" id="category">
            <option>Location1</option>
            <option>Location2</option>
            <option>Location3</option>
            <option>Location4</option>
          </Input>
        </Col>
      </FormGroup>
      <div className="d-flex justify-content-end">
        <Button type="submit" color="info" onClick={onNextStep}>
          Next step
        </Button>
      </div>
    </Form>
  );
};

const SecondPage = ({ onNextStep, onPreStep }) => {
  // const [skill, setSkill] = useState("");
  // const [skills, setSkills] = useState([]);

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log("Form data:", e.target);
  };

  // const addSkill = () => {
  //    setSkills([...skills, skill]);
  //    setSkill('');
  // };
  return (
    <Form onSubmit={handleSubmit}>
      <FormGroup>
        <Col md={6}>
          <Label for="category">Category*</Label>
          <Input type="select" name="category" id="category" required>
            <option>Category1</option>
            <option>Category2</option>
            <option>Category3</option>
            <option>Category4</option>
          </Input>
        </Col>
      </FormGroup>
      <FormGroup>
        <Label for="skill">Skills*</Label>
        <Input
          type="text"
          name="skill"
          id="skill"
          placeholder="Add a new skill..."
          required
        />
          <p>Describe your expertise to connect with mentees who have similar interests.<br/>Comma-separated list of your skills (keep it below 10). Mentees will use this to find you.</p>
        {/* <Button color="primary" onClick={addSkill}>Add Skill</Button> */}
        {/* <ul>
        {skills.map((skill, index) => (
          <li key={index}>{skill}</li>
        ))}
      </ul> */}
      </FormGroup>
      <FormGroup>
        <Label for="bio">Bio*</Label>
        <Input type="textarea" name="bio" id="bio" required/>
        <p>Tell us (and your mentees) a little bit about yourself. Talk about yourself in the first person, as if you&apos;d directly talk to a mentee. This will be public.</p>
      </FormGroup>
      <FormGroup>
        <Row>
          <Col md={6}>
            <Label for="linkedinUrl">LinkedIn URL*</Label>
            <Input type="url" name="linkedinUrl" id="linkedinUrl" required/>
          </Col>
          <Col md={6}>
            <Label for="twitterHandle">Twitter Handle (optional)</Label>
            <Input type="text" name="twitterHandle" id="twitterHandle" />
            <p>Omit the &ldquo;@&rdquo; -e.g. &ldquo;dqmonn&rdquo;</p>
          </Col>
        </Row>
      </FormGroup>
      <FormGroup>
        <Label for="personalWebsite">Personal Website (optional)</Label>
        <Input type="url" name="personalWebsite" id="personalWebsite" />
        <p>You can add your blog, GitHub profile or similar here</p>
      </FormGroup>

      <Button color="info" type="submit" onClick={onPreStep}>
        Previous step
      </Button>

      <div className="d-flex justify-content-end">
        <Button color="info" type="submit" onClick={onNextStep}>
          Next step
        </Button>
      </div>
    </Form>
  );
};
const ThirdPage = ({ onSubmit, onPreStep }) => {
  return (
    <div>
      <Alert color="info">
        Almost there! <br /> You&apos;re just one last step away from being a
        mentor and connecting with mentees all over the world! in this step,
        shows off your accomplishments and how you can help others.
        <br />
        <br /> Many of these fields are optional, but will help us get better
        insights into your work - and therefore exponentially increase your
        chances. They also give you a jumpstart once you&apos;re a mentor.
      </Alert>

      
          <FormGroup>
        <Row>
            <Col md={6}>
              <Label for="introvideo">Intro Video</Label>
              <Input type="url" name="introvideo" id="introvideo" placeholder="https://your-intro-video-URL"/>
              <p>Add a youTube video or record a Loom for your future mentees</p>
            </Col>
          
          
            <Col md={6}>
              <Label for="featuredarticle">Featured Article</Label>
              <Input type="url" name="featuredarticle" id="featuredarticle" placeholder="https://your-blog-article-URL"/>
              <p>Link an interview / podcast /piece of writing you are proud of or were featured in.</p>
            </Col>
        </Row>
          </FormGroup>
          <FormGroup>
          <Label>Why do you want to become a mentor?(Not publicaly visible)*</Label>
          <Input type="textarea" name="why" id="why" />

          </FormGroup>
          <FormGroup>
          <Label>What, in your opinion, has been your greatest achievement so far?(Not publicaly visible)*</Label>
          <Input type="textarea" name="what" id="what" />

          </FormGroup>

      
      <Button color="info" type="submit" onClick={onPreStep}>
        Previous step
      </Button>
      <div className="d-flex justify-content-end">
        <Button type="submit" color="info" onClick={onSubmit}>
          Submit application
        </Button>
      </div>
    </div>
  );
};

const Mylogin = () => {
  const [step, setStep] = useState(1);

  const handleNextStep = () => {
    setStep(step + 1);
  };
  const handlePreviousStep = () => {
    setStep(step - 1);
  };
  return (
    <Form>
      <h1>Apply as a mentor</h1>
      {step === 1 && <FirstPage onNextStep={handleNextStep} />}
      {step === 2 && (
        <SecondPage
          onNextStep={handleNextStep}
          onPreStep={handlePreviousStep}
        />
      )}
      {step === 3 && (
        <ThirdPage onSubmit={() => console.log("Form submitted")} onPreStep={handlePreviousStep} />
      )}
    </Form>
  );
};

export default Mylogin;
